import React, { Component } from "react";

import "../style.css";
import {
  BarChart,
  Bar,
  Cell,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend,
  ResponsiveContainer,
  LineChart,
  Line,
} from "recharts";

const mydata = [
  {
    description: "first",
    val: [2, 3, 4],
  },
  {
    description: "second",
    val: [5, 6, 7],
  },
];
class AnomalyChart extends Component {
  render() {
    return (
      <BarChart width={600} height={300} data={mydata} layout="vertical">
        <XAxis type="number" />
        <YAxis type="category" dataKey="description" stroke="#8884d8" />
        <Tooltip />
        <CartesianGrid stroke="#ccc" strokeDasharray="5 5" />
        <Bar dataKey="val" fill="#8884d8" barSize={30} />
      </BarChart>
    );
  }
}

export default AnomalyChart;
